export default function Task() {
  return (
    <div
      style={{
        // padding: "15px",
        display: "flex",
        justifyContent: "space-between",
        alignItem: "center",
        backgroundColor: "#252F88",
        margin: "20px 0",
      }}
    >
      <Icons />
      <div style={{ color: "white" }}>
        <h3>زيد الخير الحداد</h3>
        <p>إنجاز مشروع Todo List</p>
      </div>
    </div>
  );
}
